For 2021, the unique @turn14 x @evasivemotorsports Tesla Model 3 piloted by @daiyoshihara attempted to conquer the fabled Pikes Peak International Hill Climb. With a heavily modified chassis, bespoke aero components, and a stock Tesla drive unit, it paves the way for EV modification and racing in the future. 
